import React, { useState } from 'react';

import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import FormControl from '@material-ui/core/FormControl';
import FormLabel from '@material-ui/core/FormLabel';


import "./userSelect.css";

function userSelect() {
  const [value, setValue] = useState('Semester1');
const handleChange = (event) => {
  setValue(event.target.value);
};
  return (
    <div className="userSelect">
    <FormControl component="fieldset">
      <FormLabel component="legend">Semester</FormLabel>
      <RadioGroup aria-label="Semester" name="Semester" value={value} onChange={handleChange}>
        <FormControlLabel value="Semester1" control={<Radio />} label="Semester 1" />
        <FormControlLabel value="Semester2" control={<Radio />} label="Semester 2" />
      </RadioGroup>
    </FormControl>
    </div>
  );
}

export default userSelect;
